import React from "react";

const LibrarySong = ({ currentSong }) => {
  return (
    <div className="library-song">
      <img src={currentSong.cover} alt="Album cover"></img>
      <h3>{currentSong.name}</h3>
      <h4>{currentSong.artist}</h4>
    </div>
  );
};

export default LibrarySong;
